(11, 1, 'Home', 'home', '<div class=\"container\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-6 col-sm-offset-6 text-right wow fadeInDown animated\" style=\"visibility: visible; animation-duration: 500ms; animation-delay: 100ms; animation-name: fadeInDown;\" data-wow-duration=\"500ms\" data-wow-delay=\"100ms\">\r\n<h3 class=\"text-uppercase\">%content%</h3>\r\n<p class=\"text-right\">Manage your business, accept payments and <br />grow your clientele using Mask salon software.</p>\r\n<div class=\"link-apps\">\r\n<ul class=\"list-inline list-buttns\">\r\n<li><a class=\"btn app-btn\" href=\"https://play.google.com/store/apps/details?id=com.mask\" target=\"_blank\" rel=\"noopener\"><img class=\"app-icons\" src=\"https://www.mask-app.org//packages/Sandeep/Maskfront/resources/assets/images/play_store.png\" alt=\"\" /></a></li>\r\n<li><a class=\"btn app-btn\" href=\"https://itunes.apple.com/in/app/mask-the-address-of-beauty/id1405595135\" target=\"_blank\" rel=\"noopener\"><img class=\"app-icons\" src=\"https://www.mask-app.org//packages/Sandeep/Maskfront/resources/assets/images/app_store.png\" alt=\"\" /></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'pages/December2018/raoyDNSNLFjDwc8zfRxo.jpg', 'home', 'Discover & book', 'BEAUTY, WELNESS AND SPA APPOINTMENTS.', 'اكتشف واحجز', 'موعدك مع الجمال والصحة', 'Discover & book For Shop', 'BEAUTY, WELNESS AND SPA APPOINTMENTS. FOR SHOP', 'اكتشف واحجز', 'موعدك مع الجمال والصحة', 'home', 'home, mask', 'ACTIVE', '2018-12-12 10:19:38', '2019-01-16 11:27:06'),
(12, 1, 'ABOUT MASK', 'حول ماسك', '<p>Mask is the online destination for beauty &amp; wellness professionals and clients. Professionals can showcase their work, connect with new and existing clients, and build their business. Clients can discover new services and providers, book appointments online, and get inspired.</p>', '<p>ماسك هو وجهة لمحترفي الجمال والصحة والعملاء. يمكن للمتخصصين عرض أعمالهم والتواصل مع العملاء وبناء أعمالهم بما يناسبهم. يمكن للعملاء اكتشاف خدمات ومقدمي خدمة جدد وحجزالمواعيد عبر الإنترنت والاستمتاع بالخدمات الاخرى.</p>', NULL, 'about-mask', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ACTIVE', '2019-01-15 12:45:03', '2019-01-15 12:45:03');
